import React from 'react';
import NavBar from './NavBar';
import girl from '../images/girl.png';
const Intro = ()=>{
return (
    <div id="container">
       <NavBar></NavBar>
       <div class="intro-card">
        <div className='card-image'>
            <img src={girl}></img>
        </div>
        <div className='title'>

        </div>
       </div>
    </div>
)
}


export default Intro;
